static void
syscall_bpf__destroy(struct syscall_bpf *obj)
{
	if (!obj)
		return;
	if (obj->skeleton)
		bpf_object__destroy_skeleton(obj->skeleton);
	free(obj);
}

static inline int
syscall_bpf__create_skeleton(struct syscall_bpf *obj);

static inline struct syscall_bpf *
syscall_bpf__open_opts(const struct bpf_object_open_opts *opts)
{
	struct syscall_bpf *obj;
	int err;

	obj = (struct syscall_bpf *)calloc(1, sizeof(*obj));
	if (!obj) {
		errno = ENOMEM;
		return NULL;
	}

	err = syscall_bpf__create_skeleton(obj);
	if (err)
		goto err_out;

	err = bpf_object__open_skeleton(obj->skeleton, opts);
	if (err)
		goto err_out;

	return obj;
err_out:
	syscall_bpf__destroy(obj);
	errno = -err;
	return NULL;
}

static inline struct syscall_bpf *
syscall_bpf__open(void)
{
	return syscall_bpf__open_opts(NULL);
}

static inline int
syscall_bpf__load(struct syscall_bpf *obj)
{
	return bpf_object__load_skeleton(obj->skeleton);
}

static inline struct syscall_bpf *
syscall_bpf__open_and_load(void)
{
	struct syscall_bpf *obj;
	int err;

	obj = syscall_bpf__open();
	if (!obj)
		return NULL;
	err = syscall_bpf__load(obj);
	if (err) {
		syscall_bpf__destroy(obj);
		errno = -err;
		return NULL;
	}
	return obj;
}

static inline int
syscall_bpf__attach(struct syscall_bpf *obj)
{
	return bpf_object__attach_skeleton(obj->skeleton);
}

static inline void
syscall_bpf__detach(struct syscall_bpf *obj)
{
	bpf_object__detach_skeleton(obj->skeleton);
}

